Course.create!([
  {course_code: "CAP4028", credits: "3", prerequisites: "COP3530", corequisites: "", name: "Introduction to Game Programming", description: "Introduction to designing and building video games using high level programming languages and animation libraries. The techniques learned can be applied to simulations, instrumentation, and educational software and other software applications that require dynamic high speed interactive displays of graphic objects."},
  {course_code: "CAP4034", credits: "3", prerequisites: "", corequisites: "", name: "Computer Animation", description: "Course includes basic animation concepts, principles of animation, storyboarding, character development, animation rendering, and design. Also, 2D animations for use in practical applications are developed. Basic 3D modeling, rendering, animation techniques, and common algorithms used to create computer animation are introduced."},
  {course_code: "CAP4401", credits: "3", prerequisites: "STA4821,COP3530", corequisites: "", name: "Digital Image Processing", description: "Introduction to digitial image processing principles, tools and algorithms. Includes topics in image representation, encoding and analysis, such as filtering, transformation, segmentation, feature extraction and pattern recognition. Use of image processing software tools for lab assignments and projects."},
  {course_code: "CAP4630", credits: "3", prerequisites: "COP3530,ISM4234", corequisites: "", name: "Introduction to Artificial Intelligence", description: "A broad introduction to the core concepts of artificial intelligence, including knowledge representation, search techniques, heuristics and deduction. Programming in Lisp and possibly other software environments."},
  {course_code: "CAP4730", credits: "3", prerequisites: "COP3530", corequisites: "", name: "Computer Graphics Methods", description: "An introduction to the methods of computer graphics, including transformation, clipping, curves and surfaces, perspective, hidden lines, shading, animation, and peripheral graphics equipment."},
  {course_code: "CAP4770", credits: "3", prerequisites: "STA4821,COP3530", corequisites: "", name: "Introduction to Data Mining and Machine Intelligence", description: "This course deals with the principles of data mining. Topics include machine learning methods, knowledge discovery and representation, classification and prediction models."},
  {course_code: "CAP4833", credits: "3", prerequisites: "COP3014,COP3014L,STA4821", corequisites: "", name: "Modeling and Simulation of Systems", description: "Extending the classical world views of computer simulation with object-oriented programming and analysis. Examples from computer systems, ecology, service and manufacturing systems."},
  {course_code: "CDA3201C", credits: "4", prerequisites: "", corequisites: "COP2220", name: "Introduction to Logic Design", description: "Fundamentals of logic design, Boolean algebra, simplification of Boolean expressions, design of combinational circuits, design with SSI and MSI logic ICs including PLDs. Flip flops, analysis and synthesis of sequential circuits, design with MSI and LSI logic ICS. Training kits will be used in the lab to build logic circuits."},
  {course_code: "CDA3331C", credits: "4", prerequisites: "CDA3201C,COP2220", corequisites: "", name: "Introduction to Microprocessor Systems", description: "Architecture of a 32-bit microprocessor, addressing modes, instruction set, assembly language programming, program design, hardware model, exception handling and interface to memory and peripherals. Training kits will be used in the lab to run assembly programs."},
  {course_code: "CDA4102", credits: "3", prerequisites: "CDA3201C", corequisites: "", name: "Structured Computer Architecture", description: "A multilevel approach to computer architecture: microarchitecture level, instruction set architecture level, and operating system level. Introduction to parallel computer architectures."},
  {course_code: "CDA4204", credits: "3", prerequisites: "CDA3201C", corequisites: "CDA3331C", name: "CAD-Based Computer Design", description: "Use of Verilog hardware description language for hierarchical behavioral level design of a CPU using current industry standards and design methodologies. Techniques for performance enhancement."},
  {course_code: "CDA4210", credits: "3", prerequisites: "CDA3201C, EEE3300", corequisites: "", name: "Introduction to VLSI", description: "Exposes students to digital VLSI design and simulation tools with simple examples. Use of commercial state-of-the-art industrial CAD/CAE tools."},
  {course_code: "CDA4630", credits: "3", prerequisites: "CDA3331C", corequisites: "", name: "Introduction to Embedded System Design", description: "Unified system approach to integrate hardware and software of a state-of-the-art, real-time embedded system. Topics include an overview of high-level modeling of and design with application specific and general purpose processors, peripherals, memory, communication and protocols. Concepts include concurrent processing, real-time, control, and finite state machines in embedded systems."},
  {course_code: "CEN4010", credits: "3", prerequisites: "COP3530", corequisites: "", name: "Principles of Software Engineering", description: "An introduction to the basic principles and practices of software engineering. Exposes students to a wide range of software engineering concepts and state-of-the-art technologies. Emphasis is placed on learning and practicing software engineering principles through team course project and gaining appreciation of “programming in the large.” Topics include both technical aspects and non-technical aspects of software engineering, such as software life cycle models, specification and design methods, implementation and testing issues, deployment and post maintenance. Students are required to complete a team project involving written and oral presentations and demonstrations."},
  {course_code: "CEN4214", credits: "3", prerequisites: "Junior,Senior,Microcontrollers,C/C++", corequisites: "", name: "Software-Hardware Codesign", description: "Unified top-down system and software engineering approaches to integrate hardware and software of a state-of-the-art real-time embedded system."},
  {course_code: "CEN4400", credits: "3", prerequisites: "COP3014,3014L,STA4821", corequisites: "", name: "Introduction to Computer Systems Performance Evaluation", description: "Principles of the quantitative evaluation techniques for computer system hardware and software, emphasizing the establishment and analysis of performance criteria. Deterministic and stochastic methods will be discussed."},
  {course_code: "CEN4910", credits: "3", prerequisites: "CEN4010", corequisites: "", name: "Software Engineering Project", description: "Applies software engineering principles and practices taught in CEN4010. Students work in teams to develop a software system, following a process similar to industry practices coupled with the software engineering method and theory. Students complete a team project involving written and oral presentation and demonstrations."},
  {course_code: "CGS1570", credits: "3", prerequisites: "", corequisites: "", name: "Computer Applications 1", description: "A distance learning course for non-business, non-engineering and non-computer science majors that covers technology concepts and mastering the use of important computer applications, including word processing, spreadsheets, and presentation applications."},
  {course_code: "CGS1571", credits: "3", prerequisites: "", corequisites: "", name: "Computer Applications 2", description: "A distance learning course for non-business, non-engineering and non-computer science majors to become proficient in the use of technology and combining computer applications to solve problems in various disciplines. Includes computer networking and Internet and security basics. Also includes advanced features and blending of computer applications, such as word processing, spreadsheets, and database and presentation applications."},
  {course_code: "CIS2930", credits: "1-4", prerequisites: "", corequisites: "", name: "Topics in Computer Science and Engineering", description: "Study relating to topics in computer science and computer engineering."},
  {course_code: "CNT4104", credits: "3", prerequisites: "COP3530,CDA3331C", corequisites: "", name: "Introduction to Data Communications", description: "To develop an understanding of the various aspects of data communications and computer networking systems. Topics include data transmission, multiplexing, switching, Ethernet and WiFi, Internet protocols and architecture, Internetworking, transport and application layer protocols."},
  {course_code: "CNT4403", credits: "3", prerequisites: "COP4610", corequisites: "", name: "Introduction to Data and Network Security", description: "Overview of technical aspects of data security with emphasis on the Internet. Attacks and defenses. The design of secure systems."},
  {course_code: "CNT4713", credits: "3", prerequisites: "COP3530", corequisites: "", name: "Computer Network Projects", description: "Course provides conceptual and practical understanding of the various aspects of computer networks protocols, technologies, and measurements. Introduction to network programming with emphasis on the TCP/IP protocol suite."},
  {course_code: "COP1660", credits: "3", prerequisites: "", corequisites: "", name: "Mobile Applications for Android", description: "The course helps students develop applications for the smart phone. They use a software emulator to develop the application and a real phone to demonstrate its viability. The focus is on computer science and engineering aspects to develop, debug, test and obtain performance metrics to compare and contrast the two implementations."},
  {course_code: "COP2220", credits: "3", prerequisites: "", corequisites: "", name: "Introduction to Programming in C", description: "Introduction to programming in C. Variable types, arithmetic statements, input/output statements, loops, conditional statements, functions, arrays and structures. Programming projects in C."},
  {course_code: "COP2224", credits: "3", prerequisites: "MAC2312,MAC2282", corequisites: "", name: "Introduction to Programming in C/C++", description: "An introduction to programming in C/C++. Variable types, arithmetic statements, input/output statements, loops, if statements, functions, projects in C/C++."},
  {course_code: "COP3014", credits: "3", prerequisites: "COP2220", corequisites: "", name: "Foundations of Computer Science", description: "Builds programming skills with an emphasis on disciplined program design and coding. Introduction to object-based programming concepts including class design and implementation. Programming in C++. Must be taken with COP3014L."},
  {course_code: "COP3014L", credits: "1", prerequisites: "", corequisites: "", name: "Foundations of Computer Science Lab", description: "Laboratory experiments and exercises in Computer Science will be done. Students will learn to use Unix. Must be taken with COP3014."},
  {course_code: "COP3530", credits: "3", prerequisites: "COP3014,COP3014L", corequisites: "MAD2104", name: "Data Structures and Algorithm Analysis", description: "The design, implementation and run-time analysis of important data structures and algorithms. The data structures considered include sorted arrays, linked lists, stacks, queues, and trees. An approach based on abstract data types and classes will be emphasized. The use of recursion for algorithm design. Class design and implementation in C++. Programming assignments in the C++ language."},
  {course_code: "COP3540", credits: "3", prerequisites: "COP3530", corequisites: "", name: "Introduction to Database Structures", description: "An introduction to the design, implementation and use of file managers and relational data base systems. Topics include secondary storage devices, hash and indexed file structures, and the relational data base language SQL. Programming assignments will be done in the C language and in SQL."},
  {course_code: "COP3813", credits: "3", prerequisites: "COP3014,3014L", corequisites: "", name: "Introduction to Internet Computing", description: "This course teaches students how to design web pages and develop websites at the introductory to intermediate level. The course is project oriented. Students are required to finish several Internet-based projects using the tools introduced in class."},
  {course_code: "COP4020", credits: "3", prerequisites: "COP3530,COT4420", corequisites: "COT4420", name: "Programming Languages", description: "Covers the fundamental concepts of programming languages by discussing the design issues of the various language constructs, examining the choices for realizing these constructs in some of the most common languages and critically comparing design alternatives. Topics include a wide range of programming paradigms, how different programming languages evolve, the differences in problem domains and language suitability, the basic features of programming language translation and implementation techniques for selected language constructs. Selected programming languages assignments are used to demonstrate the language features learned in class."},
  {course_code: "COP4331", credits: "3", prerequisites: "COP3530", corequisites: "", name: "Object-Oriented Design and Programming", description: "Introduces the Java programming language and the main phases of the object-oriented development process, including requirements analysis, design and implementation. Focuses on object-oriented design principles and covers topics such as UML, design patterns, reflection, serialization, generic types and multithreading. Students collaborate on a software term project that involves the entire development cycle."},
  {course_code: "COP4367", credits: "3", prerequisites: "COP3530", corequisites: "", name: "Graphical Application Development", description: "Development of applications that use graphics to display information and have graphical user interfaces. Bitmap and vector graphics are covered. Applications are web based and standalone. Multithreading and multimedia are also covered. There are individual and group projects."},
  {course_code: "COP4593", credits: "3", prerequisites: "", corequisites: "", name: "Component Programming with .NET", description: "Microsoft .NET is explored as a component-based platform for programming Web and other applications. Emphasis is on the .NET component-based deployment model, the basic .NET programming model that is illustrated by the programming language C#, and on the higher-level programming models provided by ADO.NET and ASP.NET. Credit cannot be given for both COP4593 and COP5595."},
  {course_code: "COP4604", credits: "3", prerequisites: "COP4610", corequisites: "", name: "UNIX System Programming", description: "This is a second computer operating systems course that will give students a closer look at various functions of a computer operating system from a programmer's perspective. To gain insight into the implementation of an operating system, students will be required to do a term project by programming in C at least one of the major functions of an operating system."},
  {course_code: "COP4610", credits: "3", prerequisites: "CDA3331C,COP3530", corequisites: "", name: "Computer Operating Systems", description: "An introduction to what makes up a digital computer operating system, includes developing an understanding of interrupts, interrupt handling, processes, process management, file and device management, and other features of control programs. A team design project is required."},
  {course_code: "COP4633", credits: "3", prerequisites: "Junior,Senior,COP3530", corequisites: "", name: "Introduction to Java and Concurrency", description: "This course makes it practical and accessible to learn about concurrency and concurrent programming and to combine theory and practice in one common environment. The course allows students to verify and resolve concurrency issues at a high level of abstraction and implement the same in Java. The first one-third of the semester focuses on Java, object-oriented design and library-based design. The remainder of the course focuses on concurrency issues."},
  {course_code: "COP4703", credits: "3", prerequisites: "COP3540", corequisites: "", name: "Applied Database Systems", description: "Investigation of state-of-the-art facilities provided by object-relational database systems using Oracle as a vehicle. Java and the Java database interface, JDBC, are considered. Also, server-side web programming with dynamic SQL and CGI, PL/SQL, Java servlets, and JavaServer Pages (JSP) are considered. No prior knowledge of Java or web programming is assumed."},
  {course_code: "COP4814", credits: "3", prerequisites: "COP3813,COP3014", corequisites: "", name: "Web Services", description: "Introduction to the concept of web services as a new programming model for dynamic application interaction over the web. The class covers how to program web services using standard Java APIs and how to implement, describe, register, discover, invoke, and deploy web services using web services standards, such as SOAP, WSDL, and UDDI."},
  {course_code: "COP4854", credits: "3", prerequisites: "COP3530,COP3813", corequisites: "", name: "Cutting-Edge Web Technologies", description: "Hands-on knowledge of the latest web development tools, languages, and models. Students develop projects consisting of innovative web-based solutions. Topics include characteristics and foundations of web-based applications; web development frameworks and best practices; server-side and client-side technologies, languages and libraries; usability and human factors; and content-sharing tools and technologies."},
  {course_code: "COT2930", credits: "1-3", prerequisites: "", corequisites: "", name: "Topics in Computer Science and Engineering", description: "Study relating to specialized topics."},
  {course_code: "COT3930", credits: "1-3", prerequisites: "", corequisites: "", name: "Topics in Computer Science and Engineering", description: "Study relating to specialized topics."},
  {course_code: "COT3949", credits: "1-3", prerequisites: "", corequisites: "", name: "Cooperative Education - Computer Science/Engineering", description: "Co-op"},
  {course_code: "COT4400", credits: "3", prerequisites: "COP3530", corequisites: "", name: "Design and Analysis of Algorithms", description: "Builds upon existing skills in the mathematical analysis of algorithm complexity, including lower bounds, worst-case and average-case behavior. General techniques in algorithm design (such as divide and conquer, greedy and dynamic programming approaches) in the context of problem domains like graph, sorting and optimization problems. Introduction to the topic of NP-complete problems."},
  {course_code: "COT4420", credits: "3", prerequisites: "COP3530,MAD2104", corequisites: "", name: "Formal Languages and Automata Theory", description: "An introduction to the formal languages and automata, with emphasis on context-free and regular languages. Topics will include regular grammars, deterministic and non-deterministic finite state machines, parsing algorithms, linear-bounded automata and the use of Turing machines to introduce the P=NP problem."},
  {course_code: "COT4900", credits: "1-3", prerequisites: "", corequisites: "", name: "Directed Independent Study", description: "Study of topics relating to the special needs and interests of individual students."},
  {course_code: "COT4930", credits: "1-3", prerequisites: "", corequisites: "", name: "Topics in Computer Science and Engineering", description: "Study relating to specialized topics."},
  {course_code: "COT4935", credits: "1", prerequisites: "Senior,CS/CE majors", corequisites: "", name: "Senior Seminar", description: "Study and discussion regarding the social, legal, and ethical aspects of computing."},
  {course_code: "MAP4260", credits: "3", prerequisites: "STA4821", corequisites: "", name: "Introduction to Queueing Theory", description: "Queueing theory and its application to computer performance evaluation, operating systems analysis, telecommunications, and operations research."},
  {course_code: "STA4821", credits: "3", prerequisites: "MAC2312,MAC2282", corequisites: "", name: "Stochastic Models for Computer Science", description: "Basic principles of probability and statistics for modeling and experimentation in computer science. Topics include conditional probability, random variables, distribution and density functions, stochastic processes, queueing theory, the central limit theorem and simulation."},
  {course_code: "EEE3300", credits: "4", prerequisites: "EEL3111", corequisites: "", name: "Electronics 1", description: "Introduction to solid state devices (diodes, BJTs, FETs); op-amps, small signal amplifier analysis, large signal analysis. Use of circuit analysis programs (SPICE, etc.)."},
  {course_code: "EEE4360C", credits: "3", prerequisites: "EEL3470,EEE3300", corequisites: "", name: "High Frequency Amplifier Design", description: "Scattering parameters, matching networks and the Smith chart, amplifier stability considerations, amplifier design to meet various criteria, low noise, broadband, high power amplifier design, RF oscillator design, CAD design techniques."},
  {course_code: "EEE4361", credits: "3", prerequisites: "EEE3300", corequisites: "", name: "Electronics 2", description: "Continuation of EEE3300. Differential amplifiers, frequency response, feedback amplifiers, oscillators, power amplifiers, integrated electronics."},
  {course_code: "EEE4510", credits: "3", prerequisites: "EEL4656", corequisites: "", name: "Introduction to Digital Signal Processing", description: "Sampling and data acquisition, design of simple digital filters, programming and hardware implementation, audio applications, basic spectrum analysis using FFT."},
  {course_code: "EEE4541", credits: "3", prerequisites: "", corequisites: "EEL4656", name: "Stochastic Processes and Random Signals", description: "Introduction to probability and random processes. Response of linear systems to stochastic inputs. Distribution functions, power spectra, correlation functions, noise theory. Detection of electrical signal in the presence of noise. Applications of radar, radio signal fading, etc."},
  {course_code: "EEL1935", credits: "1-4", prerequisites: "", corequisites: "", name: "Special Topics", description: "Lower-division special topics in areas of electrical engineering not covered by other courses such as experimental advanced high school work."},
  {course_code: "EEL2161", credits: "3", prerequisites: "", corequisites: "", name: "C for Engineers", description: "Introduces the fundamental capabilities of C++ and MATLAB. Illustrates the numerical problem-solving process, testing and interpretation of results through a variety of engineering examples and applications."},
  {course_code: "EEL3012", credits: "1", prerequisites: "EGN1002", corequisites: "", name: "Electrical Engineering Practice", description: "Codes and standards - IEEE, ANSI, UL, ISO; IEEE code of ethics; professional and ethical responsibility of electrical engineers; impact of engineering solutions in a global and societal context; contemporary EE issues; lifelong learning; case studies."},
  {course_code: "EEL3111", credits: "3", prerequisites: "MAC2312,PHY2049", corequisites: "MAC2313,MAP3305", name: "Circuits 1", description: "Introductory to electric circuit analysis: passive and active sign conventions; Ohm's and Kirchhoff's laws; network analysis, theorems as applied to d-c and a-c circuits; basic op-amp circuits; single time constant transient analysis; phasor representations and sinusoidal steady state; real and reactive single phase power."},
  {course_code: "EEL3112", credits: "3", prerequisites: "EEL3111", corequisites: "", name: "Circuits 2", description: "Continuation of Circuits 1: Second order transient response; 3-phase power; Fourier series; Laplace transforms; frequency response; 2-port networks; introduction to computer analysis with PSPICE and MATLAB.;"},
  {course_code: "EEL3118L", credits: "2", prerequisites: "", corequisites: "EEE3300", name: "Electronics Laboratory 1", description: "Introduction to basic electronic test equipment; measurement techniques, experimental analysis and design of linear and non-linear circuits."},
  {course_code: "EEL3470", credits: "4", prerequisites: "EEL3111,MAC2313", corequisites: "", name: "Electromagnetic Fields and Waves", description: "Vector analysis, electrostatic fields, magnetostatic fields, transverse electromagnetic waves, reflection and refraction of plane waves, and transmission lines."},
  {course_code: "EEL4119L", credits: "3", prerequisites: "EEE4361,EEL3118L", corequisites: "EEL3470,EEL4656", name: "Electronics Laboratory 2", description: "Experiments and projects to supplement the theoretical work in core courses."},
  {course_code: "EEL4140", credits: "3", prerequisites: "EEL4656", corequisites: "", name: "Network Synthesis", description: "Introduction to filter design. Topics include physical realizability, passive and active 2-port network synthesis, sensitivity calculations, switched capacitor filters, OTAs, introduction to digital filters."},
  {course_code: "EEL4216", credits: "3", prerequisites: "EEL3111", corequisites: "", name: "Electric Power Systems", description: "Fundamentals of electromechanical devices; energy conversion, transformers and rotary machines. The operation and analysis of power systems is presented. Topics include energy supply and demand, structure of power systems, power system components, voltage and frequency control and load flows."},
  {course_code: "EEL4220", credits: "3", prerequisites: "EEL3111", corequisites: "EEL3112", name: "Electrical Machines", description: "Transformers, 3-phase distribution systems, 3-phase motors and generators, dc motors and generators, motor speed control, single phase ac motors."},
  {course_code: "EEL4281", credits: "3", prerequisites: "EEE3300", corequisites: "", name: "Photovoltaic Power Systems", description: "Sun parameters; PV system components; PV system design, including environmental and economic considerations; PV cell technologies and device theory."},
  {course_code: "EEL4421C", credits: "3", prerequisites: "EEE4360", corequisites: "", name: "RF Devices and Circuits", description: "RF filter design, active RF components and component modeling, matching and biasing networks, RF oscillators, mixers and frequency synthesizers, use of RF CAD software for system simulation."},
  {course_code: "EEL4433C", credits: "3", prerequisites: "EEL3470", corequisites: "", name: "RF and Microwave Laboratory", description: "Develop a basic understanding of modern microwave measurement techniques, practical laboratory measurements and introduction to microwave CAD design software on UNIX based workstations."},
  {course_code: "EEL4436C", credits: "3", prerequisites: "EEL3470,EEE3300", corequisites: "", name: "Microwave Engineering", description: "Review of electromagnetics, transmission lines, waveguides, microwave network analysis, impedance matching and tuning, microwave resonators, microwave power dividers, couplers and filters, microwave oscillators and mixers, CAD design techniques."},
  {course_code: "EEL4461", credits: "3", prerequisites: "EEL3470", corequisites: "", name: "Introduction to Antennas", description: "Antenna parameters, wire antennas, loop antennas, array matching techniques, broadband antennas, traveling wave antennas and antenna measurements."},
  {course_code: "EEL4478", credits: "3", prerequisites: "EEE4361,EEL3470", corequisites: "", name: "Electromagnetic Compatibility", description: "Introduction to electromagnetic compatibility (EMC), intersystem and intra-system interferences and their characteristics, coupling by conduction and radiation, shielding, and interference reduction techniques.;"},
  {course_code: "EEL4512", credits: "3", prerequisites: "EEL4656", corequisites: "", name: "Communication Systems", description: "Transmission of signals, amplitude modulation, frequency modulation, pulse modulation."},
  {course_code: "EEL4512L", credits: "1", prerequisites: "EEL4512", corequisites: "", name: "Communications Systems Lab", description: "Lab experiments include: AM and FM transmitters and receivers, time division and frequency multiplexing, phase-locked loops."},
  {course_code: "EEL4652", credits: "3", prerequisites: "EEL3112", corequisites: "", name: "Control Systems 1", description: "Introduction to classical control theory. Topics include system modeling and simulation, state variable analysis, signal flow graphs, transient and steady state response, stability analysis and design of controllers."},
  {course_code: "EEL4652L", credits: "1", prerequisites: "EEL4652", corequisites: "", name: "Control Systems Lab", description: "Lab experiments including analog computers, PID temperature control, DC servo, system identification from frequency response, computer-aided design, system simulation using MATLAB and introduction to digital control systems."},
  {course_code: "EEL4656", credits: "3", prerequisites: "EEL3112", corequisites: "", name: "Analysis of Linear Systems", description: "State variables, delta function and Impulse response, convolution, Fourier Transform and applications, discrete time systems, Z-transform and applications, Fourier transform of discrete signals."},
  {course_code: "EEL4746", credits: "3", prerequisites: "CDA3201C", corequisites: "", name: "Introduction to Microcontrollers", description: "Introduction to microcontrollers, overview of assembly language, microcontroller hardware, I/O hardware alternatives, application case studies."},
  {course_code: "EEL4746L", credits: "1", prerequisites: "CDA3201C", corequisites: "EEL4746", name: "Microcontroller Lab", description: "Ten microcontroller laboratory experiments covering topics such as assembly language, general purpose I/Os, interrupts, timer, input capture, output compare, serial and parallel communications.;"},
  {course_code: "EEL4905", credits: "1-4", prerequisites: "", corequisites: "", name: "Directed Independent Study", description: "Study of topics relating to the special needs and interests of individual students. May be taken for repeated credit."},
  {course_code: "EEL4930", credits: "1-4", prerequisites: "", corequisites: "", name: "Special Topics", description: "Topics in specialized areas, such as networks, electronics, and machines, not adequately covered in other courses. May be repeated for credit."},
  {course_code: "EEL4949", credits: "1-4", prerequisites: "", corequisites: "", name: "Cooperative Education - Electrical Engineering", description: "Cooperative work study for electrical engineering students. Grading: S/U"},
  {course_code: "ETG2831", credits: "3", prerequisites: "", corequisites: "", name: "Nature: Intersections of Science, Engineering, and the Humanities", description: "Course focuses on the reciprocal influence of science in its endeavor to understand nature, engineering in it attempts to harness nature, and the humanities in their essential role as the shapers of values. This is accomplished through a combination of learned readings, penetrating discussions, computer models and software tools, and a final project and competition. This is a General Education course."}
])
